import React from 'react';
import {Link} from "react-router-dom";

const LandingPage = () => {
    return (
        <div>
            <Link className="btn" to="/register" >Register user</Link>
            <Link to="/login" >login user</Link>
        </div>
    );
};

export default LandingPage;
